INSPIRE dataset for Human Health and Safety theme is created using input data:
1) common health indexes and health services statistics, 2) bed account in the hospitals, data provider – the Lithuanian Department of Statistics;
3) disease-specific mortality, 4) adults', and 5) school-age children's lifestyle habits, data provider – the Institute of Hygiene;
6) bathing places' hygiene, data provider – the Center for Health Education and Disease Prevention;
7)noise values, data provider – the Lithuanian Ministry of Health;
8)road traffic accidents, data provider – the Police Department. 
The output data set is created by State Enterprise GIS-Centras, Lithuania.
